function App() {
  return (
    <>
      <Navbar />
      <main>
        <section className="glass">
          <Card/>

          <BrowserRouter>
          <Routes>
            <Route exact path="/" component={FileUpload} />
            <Route exact path="/qp_search" component={questionPapersearch}/>
          </Routes>

          </BrowserRouter>





        </section>
        <div className="circle1"></div>
        <div className="circle2"></div>
      </main>
    </>
  );
}

export default App;
